		"sys": "Sistem de comunicare în rețea",
		"zs": "Modulul de control al motorului, cunoscut și sub numele de unitatea de control al motorului (unele module de control al motorului de la bord și modulele de control al transmisiei sunt integrate într-un modul de control al grupului de propulsie), controlează funcționarea întregului motor. Funcția sa principală este pentru a controla cantitatea optimă de injecție de combustibil și momentul aprinderii pentru motor.Un alt rol important este componenta responsabilă cu monitorizarea controlului emisiilor de evacuare Modulul de control al transmisiei (TCM sau TCU) ajută transmisia să decidă când și cum să schimbe treptele la face ca mașina să îmbunătățească performanța, să schimbe ușor și să economisească consumul de combustibil Controller Area Network (CAN) (Controller Area Network, CAN sau CAN bus pe scurt) este un protocol de comunicare auto, care se caracterizează prin faptul că permite rețelei Dispozitivele să comunice direct cu fiecare altele și nu este nevoie ca gazda să controleze comunicația în rețea."
