		"sys": "Sistem de comunicare în rețea",
		"zs": "Controller Area Network (CAN) (CAN sau CAN bus pe scurt) este un protocol de comunicare auto, care se caracterizează prin faptul că permite dispozitivelor din rețea să comunice direct între ele, fără a fi nevoie de comunicarea de control gazdă pe rețea.Motor Modulul de control, numit și unitatea de control al motorului (în unele mașini, modulul de control al motorului și modulul de control al transmisiei sunt integrate într-un modul de control al grupului de propulsie), controlează funcționarea întregului motor.Funcția sa principală este de a controla injecția optimă de combustibil a motorului și sincronizarea aprinderii.Un alt rol important este monitorizarea componentelor controlului emisiilor de evacuare.Comutatorul de aprindere are două funcții principale: 1) Permite șoferului să controleze alimentarea cu energie a diverselor accesorii, astfel încât să evite puterea bateriei fiind descărcată după ce motorul este oprit; 2) Când mașina pornește, conectați bateria la demaror. Comutatorul de alimentare are în general patru trepte: OFF (OPRIT), accesoriu (ACC), ON (ON) și START (START)."
